  false,\n\t\"url\": null,\n\t\"notes\": \"This report covers the freshwater ecology
  of Amchitka Island. The objective of the study was to conduct a preliminary survey
  of lake types including chemical, physical, and biological characterization of each
  lake in order to document past and present environmental disturbance and to predict
  the extent of possible future disturbance. Methods, results, and recommendations
  are discussed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
